                        <tr>
                          <td colspan="2"><p align="center" style="margin-top: 0px;"><br>
                              <span class="style4">Willkommen bei <strong>Katharina</strong> Kreuzfahrten </span></p>
                            <p style="margin-top: 0px;">Wenn Sie Indonesien einen Besuch zwecks Tauchen oder Segeln abstatten wollen, lassen Sie sich nicht die M&ouml;glichkeit eines an-Bord-Erlebnisses auf einem unserer klassischen motorgest&uuml;tzten Segelboote entgehen. Unser Segelboot Duyung erm&ouml;glicht Ihnen eine angenehme Fahrt zu entfernten, unerreichbaren und exotischen Zielen. </p>
                            <p align="center" style="margin-top: 0px;"><img src="katharina/katharina_index.jpg" width="450" height="179"></p>
                            <p align="center" style="margin-top: 0px;">Die Katharina ist das ideale an-Bord-Erlebnis f&uuml;r kleine Gruppen von bis zu 6 Tauchern. Dieses makellos reine und augezeichnet gef&uuml;hrte Boot ist das Zuhause von Volker Korth (auch als Vovo bekannt), und Yani, seiner Frau. </p>
                            <p>Vovo und Yanni werden hilfreich von ihren beiden Crew-Mitgliedern Merajap und Achmat unterst&uuml;tzt, welche leise und effizient im Hintergrund arbeiten, wo sie Zylinder f&uuml;llen, Tauchgep&auml;ck auf- oder entladen, und das Boot Tag f&uuml;r Tag zum Laufen bringen. <br>
                                <br>
  Das Essen an Bord der Katharina  wird k&ouml;stlich und liebevoll von Yani zubereitet, welche den Tag &uuml;ber angestrengt daf&uuml;r arbeitet, die G&auml;ste mit authentischer indonesischer Cuisine zu bewirten. Frischer Fisch, Tintenfisch, Huhn, frisches Gem&uuml;se, hausgemachte Suppen, Kuchen, Fr&uuml;chte und frisch gebackenes deutsches Brot jeden Tag. Sie bereitet au&szlig;erdem Fruchts&auml;fte frisch zu und serviert au&szlig;erdem den besten Kaffee, den ich jemals gekostet habe.</p>
                            <p><img src="katharina/katharina_index2.jpg" width="450" height="147"></p>
                            <p>Die Mahlzeiten werden entweder im Salonareal oder oben auf dem &uuml;berschatteten Speiseareal gereicht. </p>
                            <p>Trinkwasser ist stets den ganzen Tag verf&uuml;gbar. Nach einem erfolgreichen Tauchtag k&ouml;nnen Bier und Softdrinks an Bord erstanden werden (zu &auml;u&szlig;erst vern&uuml;nftigen Preisen). Vovo und Yani freuen sich auch, wenn Sie ihren eigenen Alkohol und Wein mit an Bord bringen (am besten auf Bali erstehen, da die Auswahl in Flores sehr begrenzt ist).</p></td>
